  false,\n\t\"url\": null,\n\t\"notes\": \"The Montezuma Wetlands Complex Project
  (MWC) is a land conservation and management project jointly sponsored by the U.
  S. Fish and Wildlife Service, New York State Department of Environmental Conservation
  and Ducks Unlimited, Inc. under the auspices of the North American Waterfowl Management
  Plan and the 1991 Northern Montezuma Wetlands Project Final Environmental Impact
  Statement. This Management Plan is a 20-year plan that presents detailed strategies
  for protecting, restoring and managing wetland ecosystem functions for wildlife
  and people in the 50,000-acre MWC located in central New York's Finger Lakes Region.
  Although wildlife management is a primary focus of the project, other natural resource
  and cultural values and interests exist. This plan contains management strategies
  designed to recognize and integrate these other values and interests with wildlife
  management objectives.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
